import React from "react";
import { Link } from "react-router-dom";
import "./BodyCream.css";

class BodyCream extends React.Component {
  render() {
    return (
      <>
        <header>Body Cream</header>
        <div class="cream"></div>
        <Link to="/">Go Home</Link>
      </>
    );
  }
}

export default BodyCream;
